steps.onInit:
scenario.question = scenario.scenarioArgs.question;
scenario.profile = scenario.scenarioArgs.profile;
scenario.questionsNum = scenario.scenarioArgs.questionsNum;
scenario.dontKnowRegex = "[D,d]on[',']?t [K,k]now|[N,n]ot [S,s]ure|[D,d]on[',']?t [W,w]ant [T,t]o [A,a]nswer";

if (scenario.response.entity === "Yes") {
    scenario.response = "true";
} else if (scenario.response.entity === "No") {
    scenario.response = "false";
} else {
    scenario.response = null;
}

if (scenario.response && new RegExp(scenario.dontKnowRegex).test(scenario.response)) {
    scenario.response = null;
}

if (new RegExp(scenario.dontKnowRegex).test(scenario.responseNum)) {
    scenario.num = null;
} else {
    scenario.num = parseFloat(scenario.responseNum);
}

if (scenario.num != null) {
    scenario.response = scenario.num.toString();
} else {
    scenario.response = null;
}

var ayalonEntityType;

if(!scenario.question.value) {
    ayalonEntityType = "";
}else {
    let keyValuePairs = scenario.question.value.split(";").map(chunk => chunk.split(":"));
    const map = new Map(keyValuePairs);
    ayalonEntityType = map.get("EntityType");
    if(ayalonEntityType) {
        ayalonEntityType = ayalonEntityType.toUpperCase();
    }
    const attributeType = map.get("AttributeType");
    if(attributeType)  {
        ayalonEntityType += "-" + attributeType.toUpperCase();
    }
}
const semanticTypeKey = ayalonEntityType + "," + scenario.question.semanticType;
let concept =  scenario.languageJson.allowedConcepts[scenario.question.code] || scenario.languageJson.textualConcepts[scenario.question.code] || 
    scenario.languageJson.textualConcepts[scenario.question.code.toUpperCase().replace('-', ' ')];
if(concept != null) {
    // has question by concept
    scenario.questionText = concept.question;
    scenario.question.name = concept.name;
    scenario.choices = concept.choices;
    scenario.multiChoice = concept.multiChoice;
    scenario.answerType = concept.answerType;
}
else if (scenario.languageJson.semanticTypes[semanticTypeKey] != null) {
    // if has question by entity type X semantic type
    scenario.questionText = scenario.languageJson.semanticTypes[semanticTypeKey].question;
    scenario.answerType = scenario.languageJson.semanticTypes[semanticTypeKey].answerType;
}
else if (scenario.languageJson.entityTypes[ayalonEntityType] != null) {
    // if has question by entity type
    concept = scenario.languageJson.entityTypes[ayalonEntityType];
    scenario.questionText = concept.question;
    scenario.choices = concept.choices;
    scenario.multiChoice = concept.multiChoice;
    scenario.answerType = concept.answerType;
}  else {
    // got concept id without a valid question mapped to it
    // this should not happend
    scenario.questionText = scenario.question.name + "?"
    scenario.answerType = "Boolean";
}

scenario.questionText = scenario.questionText.replace("%p1%", scenario.question.name);

var userQuestion = {};
userQuestion.question = scenario.concept;
userQuestion.questionText = scenario.questionText;
userQuestion.profile = scenario.profile;
userQuestion.questionsNum = scenario.questionsNum;
session.logCustomEvent('USER_QUESTION', userQuestion);

// first child answer type
scenario.multiChoiceAnswerType = Object.values(scenario.multiChoice)[0].answerType;

const choicesCardArr = [];

if (scenario.multiChoiceAnswerType === 'Boolean') {
    choicesCardArr.push({
        "type": "Input.ChoiceSet",
        "isMultiSelect": true,
        "style": "compact",
        "choices": Object.keys(scenario.multiChoice).map(k => ({
            title: scenario.multiChoice[k].name,
            value: k
        })),
        "placeholder": "Placeholder text",
        "id": "choices"
    });
} else if (scenario.multiChoiceAnswerType === 'Choice') {
    for (const choiceCode in scenario.multiChoice) {
        let choiceObj = scenario.multiChoice[choiceCode];
        // push columnSet with 2 columns ie. title => ChoicesSet
        choicesCardArr.push({
            "type": "ColumnSet",
            "columns": [
                {
                    "type": "Column",
                    "items": [{
                        "type": "TextBlock",
                        "size": "Small",
                        "text": choiceObj.name
                    }],
                    "width": "100px"
                },
                {
                    "type": "Column",
                    "items": [
                        {
                            "id": choiceCode,
                            "type": "Input.ChoiceSet",
                            "choices": choiceObj.choices.map(c => ({
                                "title": c,
                                "value": c
                            })),
                            "value": choiceObj.choices[0]
                        }
                    ],
                    "width": "stretch"
                }
            ]
        });
    }
}

scenario.cardBody = [
    {
        "type": "TextBlock",
        "text": scenario.questionText,
        "size": "Medium",
        "weight": "Bolder",
        "wrap": true
    },
    ...choicesCardArr,
    {
        "type": "ActionSet",
        "Id":"Submit",
        "actions": [
            {
                "type": "Action.Submit",
                "title": "Submit"
            },
            {
                "type": "Action.Submit",
                "title": "Don't know / Don't want to answer",
                "data": {
                    "dontKnow": true
                }
            }
        ]
    }
];

// if the answer is not object or is object and unknown
if (typeof scenario.response !== "object" || scenario.response.dontKnow) {
    scenario.response = null;
}

scenario.result = [{
    ...scenario.question,
    value: scenario.response
}]

let resultSet = new Set([]);
// the response is null only when user answers "don't know"

// get multichoice selected values in set
if (scenario.response != null && scenario.multiChoiceAnswerType == "Boolean") {
    resultSet = new Set(scenario.response.choices?.split(",") || []);
}

scenario.result = Object.keys(scenario.multiChoice).map(choiceCode => {
    let answer = null;
    if (scenario.response != null) {
        // in this case codes that are not in resultSet are falsy
        if (scenario.multiChoiceAnswerType == "Boolean") {
            if (resultSet.has(choiceCode)) {
                answer = "True";
            } else {
                answer = "False";
            }
        } else {
            answer = scenario.response[choiceCode];
        }
    }
    return {
        ...scenario.question,
        code: choiceCode,
        value: answer,
        answerType: scenario.multiChoiceAnswerType,
    };
});

scenario.luis = scenario.scenarioArgs.luis;

scenario.consts = {};
scenario.consts.TRIALS_THRESHOLD = 5;
scenario.consts.QUESTIONS_THRESHOLD = 5;
scenario.consts.MIN_AGE = 0;
scenario.consts.MAX_AGE = 120;
scenario.location = {};

var userProfile = {
    Info : {}
};

userProfile.id = "12"
// gender 
if (scenario.luis.sex != null) {
    userProfile.Info.sex = scenario.luis.sex;
} else {
    if (scenario.sexValue.entity !== "Prefer not to say") {
        userProfile.Info.sex = scenario.sexValue.entity.toLowerCase();
    }else{
        userProfile.Info.sex = "unspecified"
    }
}
// age
if (scenario.ageValue != null) {
    var birthYear = 2022 - parseInt(scenario.ageValue);
    userProfile.Info.birthDate = "01/01/"+ birthYear;
} else {
userProfile.Info.birthDate = scenario.ageValue;
}
// condition
if (scenario.luis.condition != null) {
    userProfile.condition = scenario.luis.condition;
} else {
    userProfile.condition = scenario.conditionValue;
}
// location
if (scenario.luis.location != null) {
    scenario.location.searchLocationCountryOrRegion = scenario.luis.location.countryOrRegion;;
    scenario.location.searchLocationState = scenario.luis.location.state;
    scenario.location.searchLocationCity = scenario.luis.location.city;
} else {
    scenario.location.searchLocationCountryOrRegion = scenario.locationObj.CountryOrRegion != null ? scenario.locationObj.CountryOrRegion : null;
    scenario.location.searchLocationState = scenario.locationObj.State != null ? scenario.locationObj.State : scenario.State != null ? scenario.State: null;
    scenario.location.searchLocationCity = scenario.locationObj.City != null ? scenario.locationObj.City : null;
}
if(scenario.location.searchLocationCountryOrRegion !== "United States") {
    scenario.location.searchLocationState = null;
}
// assign values to scenario
scenario.userProfile = userProfile;

