var cardBody = scenario.trials.map(trial => {
    return {
		"type": "Container",
		"separator": true,
		"spacing": "Large",
		"items": [
            {
                "type": "TextBlock",
                "text": "RECRUITING",
                "separator": true,
                "color": "dark"
            },{
                "type": "TextBlock",
                "color": "accent",
                "text": "[" + trial.description + "](https://clinicaltrials.gov/ct2/show/" + trial.id + ")",
                "spacing": "none",
                "wrap": true,
                "color": "blue"
            },{
                "type": "TextBlock",
                "text": "Clinical trial ID: " + trial.id,
                "isSubtle": true,
                "weight": "lighter"
            }
        ]
    }
});

scenario.card = {
  "$schema": "http://adaptivecards.io/schemas/adaptive-card.json",
  "type": "AdaptiveCard",
  "version": "1.0",
  "body": cardBody
};

scenario.clu = scenario.scenarioArgs.clu;

scenario.consts = {};
scenario.consts.TRIALS_THRESHOLD = 5;
scenario.consts.QUESTIONS_THRESHOLD = 5;
scenario.consts.MIN_AGE = 0;
scenario.consts.MAX_AGE = 120;
scenario.location = {};

// temp variables for normalization
scenario.locationCity = null;
scenario.locationCountryOrRegion = null;
scenario.locationState = null;
scenario.condition = null;
var ageObj = null;
// for research and improving language model
var notMappedEntities = [];
// conversation started with arguments
if (scenario.clu != null) {
    // iterate all CLU entities and set their values
    scenario.clu.forEach(ent => {
        switch (ent.category) {
            case "gender.male":
                scenario.sex = 'male';
                break;
            case "gender.female":
                scenario.sex = 'female';
                break;
            case "age":
                if (ent.resolutions && ent.resolutions.length == 1) {
                    ageObj = ent.resolutions[0];
                }
                break;
            case "disease":
                scenario.condition = ent.text.replace(" - ", "-");
                break;
            case "geography.city":
                scenario.locationCity = ent.text;
                break;
            case "geography.countryOrRegion":
                scenario.locationCountryOrRegion = ent.text;
                break;
            case "geography.state":
                scenario.locationState = ent.text;
                break;
            default:
                notMappedEntities.push(ent.entity);
        }
    });
}

// age normalization
if (ageObj != null) {
    switch (ageObj.unit) {
        case "Year":
            scenario.age = ageObj.value;
            break;
        case "Month":
            scenario.age = (+ageObj.value / 12) + "";
            break;
        case "Week":
            scenario.age = (+ageObj.value / 52) + "";
            break;
        case "Day":
            scenario.age = (+ageObj.value / 365) + "";
            break;
        default:
            scenario.age = null;
    }
}
// location normalization
scenario.location = {};
scenario.location.countryOrRegion = scenario.locationCountryOrRegion;
scenario.location.state = scenario.locationState;
scenario.location.city = scenario.locationCity;

var userProfile = {
    id: "12",
    condition: scenario.condition,
    Info : {
        sex: scenario.sex,
        birthDate: scenario.birthDate,
    }
};

// location
scenario.location.searchLocationCountryOrRegion = scenario.location.countryOrRegion;
scenario.location.searchLocationState = scenario.location.state;
scenario.location.searchLocationCity = scenario.location.city;

// assign values to scenario
scenario.userProfile = userProfile;

