steps.onInit:
// location
scenario.location = scenario.location || {}
scenario.location.countryOrRegion = scenario.location.countryOrRegion || scenario.locationObj?.CountryOrRegion;
scenario.location.state = scenario.location.state || scenario.locationObj?.State;
scenario.location.city = scenario.location.city || scenario.locationObj?.City;

if(!scenario.location.countryOrRegion){
    // USA as defalt country
    scenario.location.countryOrRegion = "United States"
    session.trace("setting default country: United States", 0);
}

// age
let age = scenario.age || scenario.ageValue
var birthYear = new Date().getFullYear() - parseInt(age);
scenario.birthDate = "01/01/"+ birthYear;
session.trace("normelized age:" + scenario.birthDate, 0);

// gender/sex


scenario.sex = scenario.sex || scenario.sexValue?.entity.toLowerCase();
if (!scenario.sex || scenario.sex == "prefer not to say") {
    scenario.sex = "unspecified"
}

scenario.timeStarted = new Date().getTime();
scenario.totalQuestionsAsked = 0;
scenario.questionIndex = 0;
scenario.clu = scenario.scenarioArgs.entities;
scenario.asyncRes = {};

scenario.consts = scenario.metadataScenarioResponse.consts;
// add explicit log
scenario.consts.TRIALS_LOG_LIMIT = 100;

scenario.profile = scenario.metadataScenarioResponse.userProfile;
scenario.location = scenario.metadataScenarioResponse.location

// initialize askedCodes
scenario.profile.Info.ClinicalInfo = [];

// initialize healthInsightsRequest
var healthInsightsRequest = {};
var configuration = {
    ClinicalTrials: {
        RegistryFilters : [
            {
            Sources : ["Clinicaltrials_gov"],
            Conditions : [scenario.profile.condition],
            FacilityLocations: [{
                "State":scenario.location.searchLocationState,
                "City":scenario.location.searchLocationCity,
                "CountryOrRegion":scenario.location.searchLocationCountryOrRegion
            }]
            }
        ]
    },
    IncludeEvidence : false,
    Verbose: false
}
var patients = [];
patients[0] = scenario.profile;

healthInsightsRequest.id = new Date().getTime().toString();

healthInsightsRequest.Configuration = configuration;
healthInsightsRequest.Patients = patients;

scenario.healthInsightsRequest = healthInsightsRequest;

var trialIds = scenario.trials.map(trial => trial.id);

// initialize qeRequest
scenario.healthInsightsRequest = {};
var configuration = {
    ClinicalTrials: {
    RegistryFilters : [
            {
                Sources : ["Clinicaltrials_gov"],
                Ids:trialIds,
            }
        ]
    },
    IncludeEvidence : false,
    Verbose: false
}
var patients = [];
patients[0] = scenario.profile;


scenario.healthInsightsRequest.Configuration = configuration;
scenario.healthInsightsRequest.Patients = patients;

// keeping track for total questions
scenario.totalQuestionsAsked++;

var criterion = scenario.HealthInsightsAsyncResponse.response.results.patients[0].neededClinicalInfo[scenario.questionIndex];
       
scenario.questionArgs = {};
scenario.questionArgs.question = criterion;
scenario.questionArgs.profile = scenario.profile;
scenario.questionArgs.questionsNum = scenario.totalQuestionsAsked;

// update scenario.trialsCountPrev and scenario.trials
scenario.trialsCountPrev = scenario.trials.length;

scenario.trials = scenario.HealthInsightsAsyncResponse.response.results.patients[0].inferences.filter(trial => trial.value == "Eligible");

var trialIds = scenario.trials.map(trial => trial.id);


// initialize qeRequest
scenario.healthInsightsRequest = {};
var configuration = {
    ClinicalTrials: {
    RegistryFilters : [
        {
            Sources : ["Clinicaltrials_gov"],
            FacilityLocations: [{
                "State":scenario.location.searchLocationState,
                "City":scenario.location.searchLocationCity,
                "CountryOrRegion":scenario.location.searchLocationCountryOrRegion
            }],
            Ids:trialIds
        }
    ]
    },
    IncludeEvidence : false,
    Verbose: true
}
var patients = [];
patients[0] = scenario.profile;


scenario.healthInsightsRequest.Configuration = configuration;
scenario.healthInsightsRequest.Patients = patients;

scenario.startBufferTrials = 0;
scenario.endBufferTrials = 50;

var trials = [];
scenario.HealthInsightsAsyncResponse.response.results.patients[0].inferences.forEach(trial => {
    if(trial.value == "Eligible") {
        trials.push(trial);
    }
});

scenario.trials = trials;
scenario.trialsBuffer = trials.slice(scenario.startBufferTrials, scenario.endBufferTrials);

var healthInsightsRequest = {};
healthInsightsRequest.trials = scenario.trials.slice(0, scenario.consts.TRIALS_LOG_LIMIT).map(trial => {
    return {
        "id": trial.id
    };
});
healthInsightsRequest.qeTrialsNum = scenario.trials.length;
session.logCustomEvent('healthInsightsRequest_#1', healthInsightsRequest);

var trialResults = {};
trialResults.totalQuestions = scenario.totalQuestionsAsked;
trialResults.resultTrialsNum = scenario.trials.length;
trialResults.qeTrialsNum = scenario.qeTrials.length;
trialResults.resultTrials = scenario.trials.slice(0, scenario.consts.TRIALS_LOG_LIMIT).map(trial => {
    return {
        "trialId": trial.id,
        "sponsor": trial.leadSponsor
    };
});
trialResults.secondsSpent = (new Date().getTime() - scenario.timeStarted) / 1000;
trialResults.profile = scenario.profile;
session.logCustomEvent('TRIALS_RESULTS', trialResults);

var continueAskingExtended = {};
continueAskingExtended.entity = scenario.continueAsking.entity;
continueAskingExtended.trialsNum = scenario.trials.length;
session.logCustomEvent('USER_CONTINUE_ASKING_RESPONSE', continueAskingExtended);

var userAnswer = {};
userAnswer.questionsNum = scenario.totalQuestionsAsked;
userAnswer.answer = scenario.questionGenerationResponse;
userAnswer.profile = scenario.profile;
session.logCustomEvent('USER_ANSWER', userAnswer);

var disqualifyResponseExtended = {};
disqualifyResponseExtended.userAnswer = scenario.questionAnswer;
disqualifyResponseExtended.disqualifiedTrialsNum = scenario.trialsCountPrev - scenario.trials.length;
disqualifyResponseExtended.questionsNum = scenario.totalQuestionsAsked;
session.logCustomEvent('DISQUALIFY_RESPONSE', disqualifyResponseExtended);

const trials = scenario.HealthInsightsAsyncResponse.response.results.patients[0].inferences.filter(trial => trial.value == "Eligible");

scenario.trials = trials;
scenario.trialsCountPrev = trials.length;
scenario.qeTrials = scenario.trials;
session.trace("demographic query has returned:" + trials.length + " trials", 0);

scenario.startBufferTrials += 50;
scenario.endBufferTrials += 50;
scenario.trialsBuffer = scenario.trials.slice(scenario.startBufferTrials, scenario.endBufferTrials);
